import Restaurant from "../Model/Restaurant.js";


export const getRestaurants = async (req, res) => {
    try {
        const restaurants = await Restaurant.find({});
        res.json(restaurants);
    } catch (error) {
        res.status(500).json({ error: error.message });
    }
};

